const t={title:"什麼Nostr",p1:"Nostr 代表 Notes and Other Stuff Transmitted by Relays。Nostr 已從一年前的 50 名活躍用戶發展到如今的 300,000 名。",p2:"Nostr 不是您註冊的應用程序或服務，它是一種無需許可的開放標準，如 TCP/IP 和 HTTP。 任何人都可以在不徵得任何人許可的情況下進行構建。沒有人能控制。",p3:"Nostr 的設計非常簡單, 使人們能夠參與去中心化的社交網絡。它不僅可以取代twitter/facebook/instagram/spotify/etc, 還可以取代提供信息交換服務的公司。"},s={title:"Nostr 與 Web3",p1:"香港目前正在追求Web3。",p2:"Nostr + Bitcoin + Lightning 是“Web3”的自然形態, 有可能在 5-10 年內出現。",p3:"Nostr + Bitcoin + Lightning 是發現以應對真實人遇到的真實問題的網絡和技術。",p4:"這種網絡在沒有開發團隊、營銷團隊、領導層和任何形式的融資的情況下迅速發展。"},e={title:"加入群组",p1:'在這個<a href="https://snort.social/e/note134slxdr2np6ml5f459me8cfmzg6cgw46c2agv55mtq55mtdtcgaqu4af4l">帖子</a>下面回復來向社區介紹你自己，或者Say Hi。',p2:'如果你是新人,目前最流行的APP是<a href="https://apps.apple.com/us/app/damus/id1628663131">Damus</a> (iPhone), <a href="https://github.com/vitorpamplona/amethyst/releases/latest">Amethyst</a> (Android), 和 <a href="https://iris.to/">iris.to</a>。'},o={title:"Nostr HK Members",replyThread:"加入对话以加入 Nostr HK"},r="当前时间：",a={whatIs:t,nostrVsWeb3:s,join:e,nostrHkMembers:o,currentTime:r};export{r as currentTime,a as default,e as join,o as nostrHkMembers,s as nostrVsWeb3,t as whatIs};
